import java.util.*;
import java.io.*;

public class Main {
    static final int N = 1001;
    static int[] fib = new int[1001];

    public static void main(String[] args) throws IOException {
        Scanner sc = new Scanner(System.in);
        PrintWriter pw = new PrintWriter(System.out);

        fib[0] = 1;
        for (int i = 1; i < 1001; i++) {
            fib[i] = (fib[i - 1] + fib[i - 2]) % N;
        }

        int t = 1;
        while (t-- > 0) {
            int v = sc.nextInt();
            int d = sc.nextInt();
            boolean[] vis = new boolean[v + 1];
            int cnt = 0;
            for (int i = 1; i <= v; i++) {
                if (!vis[i]) {
                    cnt++;
                    vis[i] = true;
                    for (int j = i + 1; j <= v; j++) {
                        if (Math.abs(fib[i] - fib[j]) < d) {
                            vis[j] = true;
                        }
                    }
                }
            }
            pw.println(cnt);
        }

        pw.close();
    }
}
